_⚠️ Potential issue_

**Missing persistence in updateTask method.**

The `updateTask` method updates the model properties but doesn't save the changes to the database. This could lead to data loss if the calling code doesn't explicitly call `save()`.


Add database persistence:

```diff
   async updateTask(updateData: {
     title?: string;
     description?: string;
     assignee_id?: number;
     due_date?: Date;
     priority?: TaskPriority;
     status?: TaskStatus;
     categories?: string[];
     is_deleted?: boolean;
   }): Promise<void> {
     if (updateData.title !== undefined) {
       this.title = updateData.title;
     }
     if (updateData.description !== undefined) {
       this.description = updateData.description;
     }
     if (updateData.assignee_id !== undefined) {
       this.assignee_id = updateData.assignee_id;
     }
     if (updateData.due_date !== undefined) {
